(1342, '', '', 'ashleyimperato98@gmail.com', '+18457011488', 'Ashley', 'Imperato', 'Ashleylynn98', '$2y$10$myac76AR2Smjoyb6FrleeuyU4NYxzUMNFc0oNJG6Q8GR3CCYegCua', 'https://learnme.live/uploadfiles/userphoto/1617755616292.png', '', 'man', '', 'seller', '1', 'Hi everyone!! My name is Ashley (you can call me Ash). I have been dancing since I was 4 years old, and started teaching when I was 14!  I teach several different styles such as ballet, jazz, tap, contemporary, and hip hop. Hip hop and contemporary are my personal favorites but I love everything about dance in general! Growing up I’ve tried many different hobbies, and career choices but I always end up coming back to dance. I have taught at my dance studio ages 6 and up, for the last 8 years. Over the summers, I am the dance director at a sleep away camp called Tyler Hill! I host the biggest dance competition in Wayne County as well as choreographing 5 different routines to be competed. I LOVE IT! \nI can promise that not only will you learn technique and the fundamentals of dance when working with me, but you will leave every session feeling inspired and uplifted in every way. It amazes me that people can come together from all different backgrounds and connect through dance. We all have that one connection and that’s what makes the dance community so powerful. My biggest goal when going into any session with any dancer is that they always learn something no matter how big or small. Whether it’s about dance, or life, I always want you to leave with something positive and uplifting. In a time of uncertainty, my biggest hope is to bring some sort of light through dance and instill it into you. Butttt, enough about me! I want to get to know YOU! \nLet’s get dancing!! ', 'English', 'comfortable clothes, dance shoes (optional), yoga mat (optional) ', '2021-04-06 17:33:36', 1, 'enRGpcl6hkJ2g69S1oBjkS:APA91bEclbAoCVq19Dc1_qCVwSffnTtM-csjZARLzx2uR334kZ37IVLAnftdVGKljB58VTRhtbnMiPKTtOtrzaDkYNfBk9B-gf2gkHf71W_9nGH-bPEemoN